import Col from 'react-bootstrap/Col'


class App extends React.Component{

    render(){
        return (
            <Container>
                <h2>Sleeping Arrangements</h2>
                <Row>
                    <Col  md={3}>
                        <Card>
                            <FaBed />
                            <FaBed />
                            <p>Bunk Bed</p>
                        </Card>
                    </Col>
                    <Col  md={3}>
                        <Card>
                            <FaBed />
                            <p>Bunk Bed</p>
                        </Card>
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default App;
